   "source": [
    "# Top items visualization\n",
    "item_freq <- table(groceries$itemDescription)\n",
    "item_freq <- sort(item_freq, decreasing = TRUE)\n",
    "barplot(head(item_freq, 10), las = 2, main = \"Top 10 Items Frequency\", \n",
    "        xlab = \"Items\", ylab = \"Frequency\", col = \"blue\", cex.names = 0.7)"
   ]
  },
