   "source": [
    "The summary output shows that the Apriori algorithm found 450 rules that describe how certain items are often bought together. Most rules involve just two items. The rules vary in strength – some are more reliable than others, and some combinations are more common. The 'lift' measure tells us that certain items are more likely to be bought together than separately. The data used for this analysis included almost 15,000 shopping baskets.\n"
